window.bookSummaryJSON = "<p>A virus devastates humanity. Few men survive. The rest are monsters. The women are dead, except Evie.</p> <p>Through a quirk in her genetics, she survives. When her physiology begins to evolve, she must come to terms with what she is and accept her role in finding a cure.</p> <p>The mutated hunt her. The men brutalize her...except three. Cryptic warrior, contrite lover, caring enemy: they are fiercely protective of the last living woman, but divided in their own agendas. Can they come together to protect the only hope for humanity? Evie must survive.</p>"; 
